import Inputs from'../components/input'
import Button from '@material-ui/core/Button';
export default class Login extends Component {

  render() {
    return (
      <div class="Login">
        <div id="header">
          <h1>Welcome to the Login Page</h1>
        </div>

        <Bootstrap.Form>
          <Inputs/>
          <Buttons/>
        </Bootstrap.Form>
        Click to Register

      </div>
    );
  }
}
